import React from "react";
import Navbar from "./Navbar";
import Slider from "./Slider";

function MergeComponents({getComponent}) {
    return (
        <>
            <Slider />
            <section id="content">
                <Navbar />
                {getComponent}
            </section>
        </>
    )
}
export default MergeComponents;
